import { Pipe, PipeTransform } from '@angular/core';

@Pipe({ name: 'DisplayByDelimiter' })
export class DisplayByDelimiter implements PipeTransform {
  transform(strings: (number | string)[], delimiter: string): string {
    const stringsToJoin = strings.length > 1 ? strings.filter((item) => item) : [''];
    return stringsToJoin.join(delimiter);
  }
}

import { Pipe, PipeTransform } from '@angular/core';
import { SelectOption } from './../models/select-option';

/**
 *
 * @usageNotes
 *
 * Converts a string to a dev friendly identifiable object
 *
 */
@Pipe({
  name: 'displayOptions'
})
export class DisplayOptionsPipe implements PipeTransform {
  transform(strOptions: string[], selectedOptions: string[] = []): SelectOption[] {
    return strOptions.map((option, index) => {
      return {
        id: index,
        name: option.trim(),
        selected: selectedOptions.includes(option)
      } as SelectOption;
    });
  }
}

import { Pipe, PipeTransform } from '@angular/core';
import { TechRecord } from '@app/models/tech-record.model';
import { VehicleTechRecordModel } from '@app/models/vehicle-tech-record.model';

@Pipe({ name: 'FilterMultipleRecords' })
export class FilterMultipleRecordsPipe implements PipeTransform {
  transform(multipleRecordsList: VehicleTechRecordModel[]): VehicleTechRecordModel[] {
    const vehicleTechnicalRecords = [...multipleRecordsList];

    vehicleTechnicalRecords.sort((a, b) => {
      const recordA = this.getRecord(a);
      const recordB = this.getRecord(b);

      if (recordA.make !== recordB.make) {
        return String(recordA.make).localeCompare(String(recordB.make));
      } else {
        return recordB.manufactureYear - recordA.manufactureYear;
      }
    });
    return vehicleTechnicalRecords;
  }

  getRecord(vehicleTechRecord: VehicleTechRecordModel): TechRecord {
    let record: TechRecord;

    record = vehicleTechRecord.techRecord.find(
      (tRec: TechRecord) => tRec.statusCode === 'current'
    );
    if (record !== undefined) {
      return record;
    }

    record = vehicleTechRecord.techRecord.find(
      (tRec: TechRecord) => tRec.statusCode === 'provisional'
    );
    if (record !== undefined) {
      return record;
    }

    record = vehicleTechRecord.techRecord
      .filter((tRec: TechRecord) => tRec.statusCode === 'archived')
      .sort((a, b) => new Date(b.createdAt).getTime() - new Date(a.createdAt).getTime())[0];

    return record;
  }
}

import { Pipe, PipeTransform } from '@angular/core';
@Pipe({ name: 'FilterRecord' })
export class FilterRecordPipe implements PipeTransform {
  transform(techRecordList: any): any {
    if (techRecordList && Array.isArray(techRecordList)) {
      let records = techRecordList.find((record: any) => record.statusCode === 'current');
      if (records !== undefined) {
        return records;
      }

      records = techRecordList.find((record: any) => record.statusCode === 'provisional');
      if (records !== undefined) {
        return records;
      }

      records = techRecordList.filter((record: any) => record.statusCode === 'archived');
      records.sort((a, b) => new Date(b.createdAt).getTime() - new Date(a.createdAt).getTime());
      if (records !== undefined) {
        return records[0];
      }
    } else {
      return techRecordList;
    }
  }
}

import { Pipe, PipeTransform } from '@angular/core';
@Pipe({ name: 'IsPrimaryVrm' })
export class IsPrimaryVrmPipe implements PipeTransform {
  transform(vrmsList: any, isPrimary: boolean): any[] {
    if (vrmsList) {
      return vrmsList.filter((listing: any) => listing.isPrimary === isPrimary);
    }
  }
}

import { Pipe, PipeTransform } from '@angular/core';
import { TechRecord } from '@app/models/tech-record.model';

@Pipe({ name: 'OrderByStatusPipe' })
export class OrderByStatusPipe implements PipeTransform {
  transform(techRecordList: TechRecord[]): TechRecord[] {
    if (techRecordList) {
      const orderedTechRec = [];
      let records: TechRecord = techRecordList.find(
        (record: TechRecord) => record.statusCode === 'current'
      );
      if (records !== undefined) {
        orderedTechRec.push(records);
      }

      records = techRecordList.find((record: TechRecord) => record.statusCode === 'provisional');
      if (records !== undefined) {
        orderedTechRec.push(records);
      }

      const archivedRecords: TechRecord[] = techRecordList.filter(
        (record: TechRecord) => record.statusCode === 'archived'
      );
      archivedRecords.sort(
        (a, b) => new Date(b.createdAt).getTime() - new Date(a.createdAt).getTime()
      );
      if (archivedRecords !== undefined) {
        archivedRecords.forEach((element) => orderedTechRec.push(element));
      }

      return orderedTechRec;
    }
  }
}

import { Pipe, PipeTransform } from '@angular/core';

@Pipe({ name: 'SortByDatePipe' })
export class SortByDatePipe implements PipeTransform {
  transform(listToSort: any, sortBy: string): any {
    if (listToSort) {
      return listToSort.sort(
        (a, b) => new Date(b[sortBy]).getTime() - new Date(a[sortBy]).getTime()
      );
    }
  }
}

