import { Component, OnInit, ChangeDetectionStrategy } from '@angular/core';
import { FormControl, FormGroup, Validators } from '@angular/forms';
import { SetVehicleTechRecordOnCreate } from '@app/store/actions/VehicleTechRecordModel.actions';
import { Store } from '@ngrx/store';
import { IAppState } from '@app/store/state/app.state';
import { Observable } from 'rxjs';
import { CREATE_PAGE_LABELS } from '@app/app.enums';
import { VehicleIdentifiers } from '@app/models/vehicle-tech-record.model';
import { getErrors } from '@app/store/selectors/error.selectors';
import { ClearErrorMessage, SetErrorMessage } from '@app/store/actions/Error.actions';

@Component({
  selector: 'vtm-technical-record-create',
  templateUrl: './technical-record-create.component.html',
  changeDetection: ChangeDetectionStrategy.OnPush
})
export class TechnicalRecordCreateComponent implements OnInit {
  vehicleTypes = ['PSV', 'HGV', 'Trailer'];
  createTechRecordForm: FormGroup;
  formError$: Observable<any>;
  formErrors: { vinErr: string; vrmErr: string; vTypeErr: string; requestErr: string[] } = {
    vinErr: '',
    vrmErr: '',
    vTypeErr: '',
    requestErr: []
  };
  vrmLabel = CREATE_PAGE_LABELS.CREATE_VRM_LABEL;

  constructor(private _store: Store<IAppState>) {
    this.formError$ = this._store.select(getErrors);
  }

  ngOnInit() {
    this.createTechRecordForm = new FormGroup({
      vehicleType: new FormControl('', Validators.required),
      vin: new FormControl('', [
        Validators.required,
        Validators.minLength(1),
        Validators.maxLength(21)
      ]),
      vrm: new FormControl('', Validators.required)
    });
  }

  setVrmValidators($event): void {
    const vrmControl = this.createTechRecordForm.get('vrm');

    if (
      $event.currentTarget.id === 'test-radio-PSV' ||
      $event.currentTarget.id === 'test-radio-HGV'
    ) {
      this.vrmLabel = CREATE_PAGE_LABELS.CREATE_VRM_LABEL;
      vrmControl.setValidators([
        Validators.required,
        Validators.minLength(1),
        Validators.maxLength(8)
      ]);
    } else {
      this.vrmLabel = CREATE_PAGE_LABELS.CREATE_VRM_LABEL_OPTIONAL;
      vrmControl.setValidators([Validators.minLength(1), Validators.maxLength(8)]);
    }
    vrmControl.updateValueAndValidity();
  }

  onSubmit() {
    this.formErrors.vinErr = !this.createTechRecordForm.get('vin').valid ? 'Enter a VIN' : null;
    this.formErrors.vrmErr = !this.createTechRecordForm.get('vrm').valid ? 'Enter a VRM' : null;
    this.formErrors.vTypeErr = !this.createTechRecordForm.get('vehicleType').valid
      ? 'Select a vehicle type'
      : null;

    if (!this.formErrors.vinErr && !this.formErrors.vrmErr && !this.formErrors.vTypeErr) {
      const createDetails: VehicleIdentifiers = {
        vin: encodeURIComponent(this.createTechRecordForm.get('vin').value),
        vrm: encodeURIComponent(this.createTechRecordForm.get('vrm').value),
        vType: this.createTechRecordForm.get('vehicleType').value
      };
      this.formErrors.requestErr = [];
      this._store.dispatch(new SetVehicleTechRecordOnCreate(createDetails));
    } else {
      const errors = [this.formErrors.vinErr, this.formErrors.vrmErr, this.formErrors.vTypeErr];
      this._store.dispatch(new SetErrorMessage(errors));
    }
  }
}

import { Component, OnInit, ChangeDetectionStrategy } from '@angular/core';
import { Store } from '@ngrx/store';
import { Observable } from 'rxjs';
import { map } from 'rxjs/operators';

import { IAppState } from '@app/store/state/app.state';
import {
  getVehicleTechRecordMetaData,
  getSelectedVehicleTechRecord,
  getTechViewState,
  getActiveVehicleTechRecord
} from '@app/store/selectors/VehicleTechRecordModel.selectors';
import { getVehicleTestResultModel } from '@app/store/selectors/VehicleTestResultModel.selectors';
import { MetaData } from '@app/models/meta-data';
import {
  SetViewState,
  CreateVehicleTechRecord,
  UpdateVehicleTechRecord
} from '@app/store/actions/VehicleTechRecordModel.actions';
import {
  VehicleTechRecordModel,
  VehicleTechRecordEdit,
  VehicleTechRecordEditState
} from '@app/models/vehicle-tech-record.model';
import { TestResultModel } from '@app/models/test-result.model';
import { VIEW_STATE } from '@app/app.enums';

@Component({
  selector: 'vtm-technical-record-container',
  template: `
    <ng-container *ngIf="vehicleTechnicalRecord$ | async as vehicleTechRecord">
      <div class="govuk-width-container">
        <a class="govuk-back-link" vtmBackButton>Back</a>

        <main class="govuk-main-wrapper">
          <vtm-technical-record
            [activeVehicleTechRecord]="activeVehicleTechRecord$ | async"
            [vehicleTechRecord]="vehicleTechRecord"
            [metaData]="metaData$ | async"
            [currentState]="viewState$ | async"
            [testResultJson]="testResults$ | async"
            (submitVehicleRecord)="vehicleRecordSubmissionHandler($event)"
            (changeViewState)="viewStateHandler($event)"
            (sendPlates)="sendPlatesHandler($event)"
          >
          </vtm-technical-record>
        </main>
      </div>
    </ng-container>
  `,
  changeDetection: ChangeDetectionStrategy.OnPush
})
export class TechnicalRecordsContainer implements OnInit {
  activeVehicleTechRecord$: Observable<VehicleTechRecordEdit>;
  vehicleTechnicalRecord$: Observable<VehicleTechRecordModel>;
  testResults$: Observable<TestResultModel[]>;
  metaData$: Observable<MetaData>;
  viewState$: Observable<VIEW_STATE>;

  constructor(private store: Store<IAppState>) {
    this.activeVehicleTechRecord$ = this.store
      .select(getActiveVehicleTechRecord)
      .pipe(map((f) => f()));
    this.vehicleTechnicalRecord$ = this.store.select(getSelectedVehicleTechRecord);
    this.testResults$ = this.store.select(getVehicleTestResultModel);
    this.metaData$ = this.store.select(getVehicleTechRecordMetaData);
    this.viewState$ = this.store.select(getTechViewState);
  }

  ngOnInit(): void {}

  vehicleRecordSubmissionHandler(editedVehicleRecordState: VehicleTechRecordEditState): void {
    const { vehicleRecordEdit, viewState } = editedVehicleRecordState;

    viewState === VIEW_STATE.CREATE
      ? this.store.dispatch(new CreateVehicleTechRecord(vehicleRecordEdit))
      : this.store.dispatch(new UpdateVehicleTechRecord(vehicleRecordEdit));
  }

  viewStateHandler(state: VIEW_STATE): void {
    this.store.dispatch(new SetViewState(state));
  }

  sendPlatesHandler(editedVehicleRecord: VehicleTechRecordEdit) {
    this.store.dispatch(new UpdateVehicleTechRecord(editedVehicleRecord));
  }
}

import { Component, ChangeDetectionStrategy, OnInit } from '@angular/core';
import { Store } from '@ngrx/store';
import { Observable } from 'rxjs';

import { IAppState } from '@app/store/state/app.state';
import { getErrors } from '@app/store/selectors/error.selectors';
import { GetVehicleTechRecordHavingStatusAll } from '@app/store/actions/VehicleTechRecordModel.actions';
import { SEARCH_CRITERIA } from '@app/app.enums';
import { SearchParams } from '@app/models/search-params';

@Component({
  selector: 'vtm-technical-record-search',
  templateUrl: './technical-record-search.component.html',
  styleUrls: ['./technical-record-search.component.scss'],
  changeDetection: ChangeDetectionStrategy.OnPush
})
export class TechnicalRecordSearchComponent implements OnInit {
  isLoading: boolean;
  searchError$: Observable<string[]>;
  searchCriteriaOptions = Object.values(SEARCH_CRITERIA);
  searchParams: SearchParams = { searchIdentifier: '{none searched}', searchCriteria: 'all' };

  constructor(private store: Store<IAppState>) {}

  ngOnInit() {
    this.searchError$ = this.store.select(getErrors);
  }

  public searchTechRecords(searchIdentifier: string, searchCriteria: string) {
    this.isLoading = true;
    this.searchParams.searchIdentifier = encodeURIComponent(searchIdentifier);

    switch (searchCriteria) {
      case SEARCH_CRITERIA.VRM_CRITERIA:
        this.searchParams.searchCriteria = 'vrm';
        break;
      case SEARCH_CRITERIA.FULL_VIN_CRITERIA:
        this.searchParams.searchCriteria = 'vin';
        break;
      case SEARCH_CRITERIA.PARTIAL_VIN_CRITERIA:
        this.searchParams.searchCriteria = 'partialVin';
        break;
      case SEARCH_CRITERIA.TRL_CRITERIA:
        this.searchParams.searchCriteria = 'trailerId';
        break;
      case SEARCH_CRITERIA.ALL_CRITERIA:
      default:
        this.searchParams.searchCriteria = 'all';
    }

    this.store.dispatch(new GetVehicleTechRecordHavingStatusAll(this.searchParams));
  }
}

