import {
  Component,
  Input,
  forwardRef,
  HostBinding,
  Injector,
  Type,
  OnInit,
  OnDestroy
} from '@angular/core';
import {
  FormGroup,
  ControlValueAccessor,
  NG_VALUE_ACCESSOR,
  FormControl,
  NgControl
} from '@angular/forms';
import { map, tap, takeUntil } from 'rxjs/operators';
import { Subject } from 'rxjs';
import { FormFieldControl } from '../control';

let index = 0;

@Component({
  selector: 'vtm-time-input',
  templateUrl: './time-input.component.html',
  providers: [
    {
      provide: NG_VALUE_ACCESSOR,
      useExisting: forwardRef(() => TimeInputComponent),
      multi: true
    },
    {
      provide: FormFieldControl,
      useExisting: TimeInputComponent
    }
  ]
})
export class TimeInputComponent
  implements ControlValueAccessor, FormFieldControl, OnInit, OnDestroy {
  timeInputs: FormGroup;
  controlType = 'time';
  multi = true;

  @HostBinding('attr.id')
  externalId = '';

  @Input('aria-describedby') ariaDescribedBy: string | null;
  @Input()
  set id(value: string) {
    this.internalId = value;
    this.externalId = null;
  }
  get id() {
    return `${this.internalId}-${index}`;
  }
  private internalId = '';

  @Input('value') _value = '';
  set value(val) {
    this._value = val;
    this.onchange(val);
  }
  get value() {
    return this._value;
  }

  private onDestroy$: Subject<void> = new Subject();
  private onchange: any = () => {};

  constructor(private injector: Injector) {
    index += 1;
  }

  ngOnInit(): void {
    this.timeInputs = new FormGroup({
      hour: new FormControl(''),
      minute: new FormControl('')
    });
    this.timeInputs.valueChanges
      .pipe(
        map(({ hour, minute }) => {
          const resultDate = new Date();

          resultDate.setUTCHours(hour);
          resultDate.setUTCMinutes(minute);

          if (!!resultDate.toJSON()) {
            return resultDate.toISOString();
          }

          return null;
        }),
        tap((result) => {
          this.value = result;
        }),
        takeUntil(this.onDestroy$)
      )
      .subscribe();
  }

  ngOnDestroy(): void {
    this.onDestroy$.next();
    this.onDestroy$.complete();
  }

  get ngControl(): NgControl {
    return this.injector.get<NgControl>(NgControl as Type<NgControl>);
  }

  writeValue(timeString: string): void {
    let hour = '';
    let minute = '';
    const getDate = new Date(timeString);

    [hour, minute] = !!getDate.toJSON()
      ? [getDate.getUTCHours().toString(), getDate.getUTCMinutes().toString()]
      : [hour, minute];

    this.timeInputs.patchValue({ hour, minute });
  }

  registerOnChange(fn: any): void {
    this.onchange = fn;
  }

  registerOnTouched(_: any): void {}
}

import { Component, EventEmitter, Input, OnInit, Output } from '@angular/core';
import { FlatTreeControl } from '@angular/cdk/tree';
import { MatTreeFlatDataSource, MatTreeFlattener } from '@angular/material/tree';
import { BehaviorSubject } from 'rxjs';
import { KeyValue } from '@angular/common';
import { TreeData } from '@app/models/tree-data';

export class TreeNode {
  children: BehaviorSubject<TreeNode[]>;
  isActive?: boolean;
  constructor(public nodeName: string, public id: string, children?: TreeNode[]) {
    this.children = new BehaviorSubject(children === undefined ? [] : children);
  }
}

@Component({
  selector: 'vtm-tree-component',
  templateUrl: './tree.component.html'
})
export class TreeComponent implements OnInit {
  @Input() treeData: TreeData[];
  @Output() sendTreeData = new EventEmitter<KeyValue<string, string>>();

  levels = new Map<TreeNode, number>();

  activeNode: KeyValue<string, string>;

  treeControl: FlatTreeControl<TreeNode>;
  treeFlattener: MatTreeFlattener<TreeNode, TreeNode>;
  dataSource: MatTreeFlatDataSource<TreeNode, TreeNode>;

  constructor() {
    this.treeFlattener = new MatTreeFlattener(
      this.transformer.bind(this),
      this.getLevel.bind(this),
      this.isExpandable.bind(this),
      this.getChildren.bind(this)
    );

    this.treeControl = new FlatTreeControl<TreeNode>(
      this.getLevel.bind(this),
      this.isExpandable.bind(this)
    );

    this.dataSource = new MatTreeFlatDataSource(this.treeControl, this.treeFlattener);
  }

  ngOnInit() {
    this.dataSource.data = this.treeData ? this.convertToTreeNodes(this.treeData) : [];
  }

  convertToTreeNodes(treeData): TreeNode[] {
    return treeData
      .map(this.mapTreeDataToTreeNodes.bind(this))
      .sort(this.sortTreeNodeByChildren.bind(this));
  }

  private mapTreeDataToTreeNodes(obj) {
    const hasChildren = obj.children && obj.children.length;

    if (hasChildren) {
      return new TreeNode(obj.nodeName, obj.id, this.convertToTreeNodes(obj.children));
    } else {
      return new TreeNode(obj.nodeName, obj.id);
    }
  }

  sortTreeNodeByChildren(a, b) {
    if (a.children && a.children.value < b.children && b.children.value) {
      return -1;
    }
    if (a.children && a.children.value > b.children && b.children.value) {
      return 1;
    }
    return 0;
  }

  getLevel(node: TreeNode): number {
    return this.levels.get(node) || 0;
  }

  isExpandable(node: TreeNode): boolean {
    return node.children.value.length > 0;
  }

  getChildren(node: TreeNode) {
    return node.children;
  }

  transformer(node: TreeNode, level: number) {
    this.levels.set(node, level);
    return node;
  }

  hasChildren(index: number, node: TreeNode): boolean {
    return node.children.value.length > 0;
  }

  setActiveNode(node) {
    this.treeControl.dataNodes.forEach((dnode) => (dnode.isActive = false));
    node.isActive = !node.isActive;

    this.activeNode = { key: node.id, value: node.nodeName };

    this.sendTreeData.emit(this.activeNode);
  }
}

import { Component, OnInit, ChangeDetectionStrategy, Input } from '@angular/core';
import { ControlContainer, FormGroupDirective, FormGroup, FormBuilder } from '@angular/forms';

import { TechRecord } from '@app/models/tech-record.model';
import { SelectOption } from '@app/models/select-option';
import { DisplayOptionsPipe } from '@app/pipes/display-options.pipe';
